import logo from './logo.svg';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';
import React from 'react';
import Navigation from './components/Navigation';

const App = () => {
  return (
    <Router>
      <div className='App'>
        <header className="App-header">
          <Navigation />
        </header>
      </div>
    </Router>
  );
}

export default App;
